import React, {Component} from 'react';
import Link from 'next/link';

class Navbar extends Component {
	render(){
		return (
		 <nav className="navbar navbar-expand navbar-dark bg-dark mb-4">
		    <div className="container">
		      <a className="navbar-brand" href="#">BitzPrice</a>
		      <div className="collapse navbar-collapse">
		        <ul className="navbar-nav ml-auto">
		          <li className="nav-item">
		            <Link href="/about"><a className="nav-link">About Me</a></Link>
		          </li>
		          <li className="nav-item">
		            <Link href="/skills"><a className="nav-link">My Skills</a></Link>
		          </li>
		          <li className="nav-item">
		            <Link href="/projects"><a className="nav-link">Projects</a></Link>
		          </li>
		        </ul>
		      </div>
		    </div>
		  </nav>
		)
	}
}

export default Navbar;
